import React from "react";
import "../Styles/App.scss";

function App() {
  return (
    <div className="App">
      <div className="container">
        <div className="search-input">
          <input placeholder="Search" />
          <ul className="result">
            <li>Abc</li>
            <li>Def</li>
            <li>GHI</li>
          </ul>
        </div>
      </div>
    </div>
  );
}

export default App;
